import React from 'react'
import { SliderDataAurora } from './SliderDataAurora'

export const ImageSlider = () => {
  return (
    <>
        {SliderDataAurora.map((slide, index) => {
            return (
                <img src={slide.image} alt="aurora" width="10%"/>
            )
        })}
    </>
  )
}
